import { React } from 'react';
import store from '../redux/store';
import { useParams } from 'react-router-dom';

const Nastavnik = (props) => {
  const nastavnici = store.getState().nastavnici.items;
  console.log(nastavnici);
  const { idNastavnik } = useParams();
  console.log(idNastavnik);

  const { nastavnik } = nastavnici.map((nas) => nas);
  console.log(nastavnik);
  return (
    <div>
      <p>
        aaaaaaaaaa
        {props.id} {props.ime} {props.prezime}
      </p>
      {idNastavnik &&
        nastavnici.items.map((nast) => {
          return (
            <div key={nast.idNastavnik}>
              {nast.idNastavnik}
              {nast.ime}
              {nast.prezime}
            </div>
          );
        })}
    </div>
  );
};

export default Nastavnik;
